namespace BgCommon.DbService.Models.Entities;/// <summary>/// 日志记录表数据实体./// </summary>[SqlSugarTable()]public partial class LogEntry : ObservableObject{    private long id;     private DateTime timestamp;    private string source = string.Empty;    private string level = string.Empty;    private string loggerName = string.Empty;    private string message = string.Empty;    private string exceptionInfo = string.Empty;    /// <summary>    /// Gets or Sets 唯一标识.    /// </summary>    public long Id    {        get => id;        set => SetProperty(ref id, value);    }    /// <summary>    /// Gets or Sets 时间戳.    /// </summary>    public DateTime Timestamp    {        get => timestamp;        set => SetProperty(ref timestamp, value);    }    /// <summary>    /// Gets or Sets 日志来源.    /// </summary>    public string Source    {        get        {            return source;        }        set        {            if (SetProperty(ref source, value))            {                OnPropertyChanged(nameof(SourceEnum));            }        }    }    /// <summary>    /// Gets or Sets 日志级别.    /// </summary>    public string Level    {        get => level;        set => SetProperty(ref level, value);    }    /// <summary>    /// Gets or Sets 记录器名称.    /// </summary>    public string LoggerName    {        get => loggerName;        set => SetProperty(ref loggerName, value);    }    /// <summary>    /// Gets or Sets 日志消息内容.    /// </summary>    public string Message    {        get => message;        set => SetProperty(ref message, value);    }    /// <summary>    /// Gets or Sets 异常信息.    /// </summary>    public string ExceptionInfo    {        get => exceptionInfo;        set => SetProperty(ref exceptionInfo, value);    }    /// <summary>    /// Gets 日志源枚举.    /// </summary>    public BgLoggerSource SourceEnum    {        get        {            if (Enum.TryParse(typeof(BgLoggerSource), Source, true, out object? enumValue) && enumValue != null)            {                return (BgLoggerSource)enumValue;            }            return BgLoggerSource.UnKnowm;        }    }    public override bool Equals(object? obj)    {        if (obj is LogEntry logEntry)        {            return Id == logEntry.Id &&                   Timestamp == logEntry.Timestamp &&                   string.Equals(Source, logEntry.Source, StringComparison.Ordinal) &&                   string.Equals(Level, logEntry.Level, StringComparison.Ordinal) &&                   string.Equals(LoggerName, logEntry.LoggerName, StringComparison.Ordinal) &&                   string.Equals(Message, logEntry.Message, StringComparison.Ordinal) &&                   string.Equals(ExceptionInfo, logEntry.ExceptionInfo, StringComparison.Ordinal);        }        return false;    }}